import React from 'react';
import Card from './Card.js';
import Item from './Item.js';
// import './UsersList.css';
// import './User.css';

const ItemsList = function(props) {
    return (
        <Card className="itemsListContainer"> 
            <ul>
                {props.items.map((item) => (
                  <Item
                    name={item.name}
                    img={item.img}
                    id={1232}
                   />
                ))}
            </ul>
        </Card>
    );
}

export default ItemsList;
